	NAC_tbl.caseNumber,
	NAC_tbl.timeDate,
	NAC_tbl.location,
	case_tbl.plaintiffs,
	case_tbl.defendants,
	case_tbl.filedDate,
	case_tbl.sex,
	case_tbl.dob,
	case_tbl.race,
	case_tbl.totCosts,
	case_tbl.totDeposit,
